import "./Home.css";
import Home from "./Home";
import About from "./About";

function App() {
    let component;
  switch (window.location.pathname) {
    case "/":
        component = <Home />

    case "/about":
        component = <About />




  }
  return (
    <>{component}</>
    );
}

export default App;
